import React from 'react';
import '../App.css';

class Home extends React.Component {

  render() {
    return (
        <div className="App jumbotron vertical-center img-full" style={{marginBottom: '0px'}}>
         
          <div className="container">
            <h1 className="display-1" style={{color: 'rgb(141, 141, 141)'}}>Welcome to Book Keeper</h1>
            <p><small>Your personal online bookshelf</small></p>

          </div>
          
        </div>
    );
  }
}
export default Home;
